import './Work.css';
import Tilt from 'react-parallax-tilt'
import Button from './Button'
import Code from '../Code.JPG'
import Nextclade from '../Nextclade.JPG'
import T1D from '../T1D.jpg'
import Covidfem from '../fem-covid.jpg'
  function Work(props) {
    return (
      <>
        <div className='work'>
          
          <p className="work-header">Latest Work</p>
          
          <div className="web-portfolio">
              <Tilt className="parallax-effect2" 
              tiltReverse={true}
              perspective={1000}
              tiltAngleXInitial={0}
              tiltAngleYInitial={0}
              transitionSpeed={3000}
              reset={true}
              scale={1.07}
              glareEnable={true} glareMaxOpacity={0.9} glareColor="#eee3fa" glarePosition="all" glareBorderRadius="2%"
              tiltMaxAngleX={5}
              tiltMaxAngleY={5}
              gyroscope={true}
              >
              <div className="portfolio-card" style={{ backgroundImage: `url(${Code})`}}> 
                <div className="overlay"></div>
                <div className="inner-elements">
                <Button direction="left">Visit Project</Button>
                <h1>Personal Portfolio</h1>
                <h2> React - GSAP - Express</h2>
                </div>
              </div>
              </Tilt>
              <Tilt className="parallax-effect2" 
              tiltReverse={true}
              perspective={1000}
              tiltAngleXInitial={0}
              tiltAngleYInitial={0}
              transitionSpeed={3000}
              reset={true}
              scale={1.07}
              glareEnable={true} glareMaxOpacity={0.9} glareColor="#eee3fa" glarePosition="all" glareBorderRadius="2%"
              tiltMaxAngleX={5}
              tiltMaxAngleY={5}
              gyroscope={true}
              >
              <div className="portfolio-card" style={{ backgroundImage: `url(${Nextclade})`}}>
                <div className="overlay"></div>
                <div className="inner-elements">
                <Button direction="left">Visit Project</Button>
                <h1>COVID-19 Variant Analysis</h1>
                <h2>Bash - GATK - BWA - NextClade - Pangolin</h2>
                </div>
              </div>
              </Tilt>
              <Tilt className="parallax-effect2" 
              tiltReverse={true}
              perspective={1000}
              tiltAngleXInitial={0}
              tiltAngleYInitial={0}
              transitionSpeed={3000}
              reset={true}
              scale={1.07}
              glareEnable={true} glareMaxOpacity={0.9} glareColor="#eee3fa" glarePosition="all" glareBorderRadius="2%"
              tiltMaxAngleX={5}
              tiltMaxAngleY={5}
              gyroscope={true}
              >
              <div className="portfolio-card" style={{ backgroundImage: `url(${T1D})`}}>
                <div className="overlay"></div>
                <div className="inner-elements">
                <Button direction="left">Visit Project</Button>
                <h1>Type 1 Diabietes <br></br>Three Country Cohort Analysis </h1>
                <h2> R - Kraken - Bracken - Krona - Phyloseq - AmpVis</h2>
                </div>
              </div>
              </Tilt>
              <Tilt className="parallax-effect2" 
              tiltReverse={true}
              perspective={1000}
              tiltAngleXInitial={0}
              tiltAngleYInitial={0}
              transitionSpeed={3000}
              reset={true}
              scale={1.07}
              glareEnable={true} glareMaxOpacity={0.9} glareColor="#eee3fa" glarePosition="all" glareBorderRadius="2%"
              tiltMaxAngleX={5}
              tiltMaxAngleY={5}
              gyroscope={true}
              >
              <div className="portfolio-card" style={{ backgroundImage: `url(${Covidfem})`}}>
              <div className="overlay"></div>
              <div className="inner-elements">
              <Button direction="left">Visit Project</Button>
                <h1>COVID-19 Female Differnetial Analysis </h1>
                <h2> R - DESeq - STAR Alignment - Gprofiler - EnrichR</h2>
                </div>
              </div>
              </Tilt>
          </div>
          
        </div>
        
      </>
    );
  }
  
  export default Work;
